        }
        return (
            <div className = "grid-container">
                {board}
            </div>
        );
    }
}

class Row extends Component {
    render() {
        let row = [];
        for (let i=0; i <8 ;i++) {
            row.push(<div className = "square-{i}"></div>);
        }

        return (
            <div className = "row">
                {row}
            </div>
        );
    }
}

export default Board;
